     /**
+     * Mark the best deal in prices array.
+     *
+     * @param array<int, array<string, mixed>> $deals
+     * @return array<int, array<string, mixed>>
+     */
+    public function markBestDeal(array $deals): array
+    {
+        // تحقق من أن كل عنصر يحتوي على المفاتيح المطلوبة وأنواعها صحيحة
+        $filtered = array_filter($deals, function ($item) {
+            return isset($item['price'], $item['in_stock'], $item['is_best_deal'])
+                && is_numeric($item['price'])
+                && is_bool($item['in_stock'])
+                && is_bool($item['is_best_deal']);
+        });
+
+        if (empty($filtered)) {
+            return $deals;
+        }
+
+        $filterCallback = fn(array $p): bool => isset($p['in_stock']) && $p['in_stock'] === true;
+        $inStockPrices = array_filter($filtered, $filterCallback);
+
+        if (empty($inStockPrices)) {
+            return $deals;
+        }
+
+        $pricesArray = array_column($inStockPrices, 'price');
+        $lowestPrice = min($pricesArray);
+
+        foreach ($deals as &$price) {
+            if (isset($price['in_stock'], $price['price']) && $price['in_stock'] && $price['price'] === $lowestPrice) {
+                $price['is_best_deal'] = true;
+                break;
+            }
+        }
+
+        return $deals;
+    }
+
